'use client';
import { jsx } from 'react/jsx-runtime';
import * as React from 'react';

const TableBody = React.forwardRef(({ children, ...rest }, ref) => {
    return (jsx("tbody", { ref: ref, ...rest, children: children }));
});
TableBody.displayName = 'TableBody';

export { TableBody };
